type LinearSVC struct {
	coefficients []float64
	intercepts   float64
}

func (svc LinearSVC) predict(features []float64) int {
	var prob float64
	for i := 0; i < len(svc.coefficients); i++ {
		prob = prob + svc.coefficients[i]*features[i]
	}
	if (prob + svc.intercepts) > 0 {
		return 1
	}
	return 0
}

